['Issue 427249: ASSERTION FAILED: m_pendingStylesheets > 0, Heap-use-after-free in blink::StyleEngine::clearResolver', 'VULNERABILITY DETAILS
The following testcase crashes the latest asan build of chrome.

VERSION
Chrome Version: asan-symbolized-linux-release-301067
Operating System: Linux 64bit

REPRODUCTION CASE
