["Issue 236982: Make the compositor not 'composite' canvas contents if background is black", 'some apps that use large canvases are seeing a large perf hit because the content of the canvas has to be composited with the stuff it overlaps.

The compositor can be smarter and avoid this compositing in 2 cases

1) The canvas is created without alpha 

   ctx = canvas.getContext("..", { alpha: false });

2) The canvas's background color is opaque black

   canvas {
     background-color: "black"; // or rgb(0,0,0) or rgba(0,0,0,1);
   }

Case #1 is already handled by the compositor. 

Case #2 would help apps that need destination alpha and therefore can not set alpha to false.', '']

['Issue 401476: Web Audio API clipping sound files when using setValueAtTime', "Chrome Version       :  36.0.1985.125 m
URLs (if applicable) : https://24c54acff277a4f300de21b529bb3afe8625d034.googledrive.com/host/0B96vRpJDRZz3bWJHcmtSaXlwX1k/setValueAtTime.html
Other browsers tested:
  Did not test in other browsers because of lack of support for web audio api.

What steps will reproduce the problem?
1. Follow the supplied url for an example of the issue.
2. Select the Play sound button and a sound will play.
3. Before the sound stops, click the 'Set Gain At Zero Time' button.

What is the expected result?
The sound should mute with no clipping sound.


What happens instead?
When setting the gain value to zero using setValueAtTime, there is audible
clipping sound (headphones may be needed). When using the 'Set gain to zero' button, there is no clipping sound.


Please provide any additional information below. Attach a screenshot if
possible.

This start a few weeks ago when chrome was updated to no longer be able to
access the gain directly from the buffer (example:

// Old webkitAudioContext code:
var src = context.createBufferSource();
src.buffer = someBuffer;
src.gain.value = 0.5;
src.connect(context.destination);
src.noteOn(0);

// New standard AudioContext code:
var src = context.createBufferSource();
src.buffer = someBuffer;
var gain = context.createGain();
src.connect(gain);
gain.gain.value = 0.5;
gain.connect(context.destination);
src.start(0);).

The change works fine when directly setting the gain to zero. But when setting the gain using the setValueAtTime method, the clipping is audible (see provided example from url).", '']

['Issue 237526: ~URLRequestFtpJob: NULL deref of request_', 'The test case for issue 236949 causes a different browser crash for me on linux. It is a NULL deref of request_ here:

URLRequestFtpJob::~URLRequestFtpJob() {
  if (pac_request_)
    request_->context()->proxy_service()->CancelPacRequest(pac_request_);

triggered by job_ = NULL here:

void URLRequest::OrphanJob() {
  ...
  job_->DetachRequest();  // ensures that the job will not call us again
  job_ = NULL;

DetachRequest() sets request_ = NULL.

Unminimized Testcase: https://cluster-fuzz.appspot.com/download/AMIfv947dWuohBHc5QH4jajFv2DzAAm0qOlUs98ncffXein0dplGcrujQrqKDtCCL38IaFaTeYmBSicikMIDoFUWY2pMt_D-qOI9Oep3sb0FBLbUFicO9JFI6O_zNIFJm2FWu7CoxSBZ3Fdn0JKITDFbmJwyKAOGKTjPJJCuUz0tZeNxLGJIn7E

It might take a while to trigger, pac_request_ is mostly false, but sometimes becomes true.', '']

['Issue 443672: Canceling enable-dev screen does not dismiss it', 'Chrome: 41.0.2253.0

Repro steps:
1. Use an image that has rootfs protection;
2. Invoke enable-dev screen to remove rootfs proection;
3. After device reboot and enable-dev screen shows up, try to cancel it

At step 3, enable-dev screen is expcted to be canceled and we got back to network screen. Instead, the screen stays and there is no way to cancel it.', '']

