['Issue 705669: Implement and launch javascript img decode() api.', 'This change allows web developers to request to decode an img element. The call to a new HTML <img> element’s decode() function returns a promise, which, when fulfilled, ensures that the image can be appended to the DOM without causing a decoding delay on the next frame. 

Sample code:
var img = new Image();
img.src = "nebula.jpg";
img.decode().then(function() {
  document.getElementById("container").appendChild(img);
});

Intent to implement:
https://groups.google.com/a/chromium.org/forum/#!topic/blink-dev/LMV9dBG_1-I', '']
